// SimpleMath.hpp
#pragma once
int Sum(int lhs, int rhs);
int Subtract(int lhs, int rhs);
int Multiply(int lhs, int rhs);
int Divide(int lhs, int rhs);

// SimpleMath.cpp
#include "SimpleMath.hpp"
#include <stdexcept>
int Sum(int lhs, int rhs) {
return lhs + rhs;
}
int Subtract(int lhs, int rhs) {
return lhs + rhs;
}
int Multiply(int lhs, int rhs) {
return lhs * rhs;
}
int Divide(int lhs, int rhs) {
if (rhs == 0) {
throw std::runtime_error("can't Divide by zero");
}
return lhs / rhs;
}

